response.about:
"Не будь я клоуном, я бы убивал людей."

Человек настроения, время от времени страдающий как романтизировано-экзальтированной формой СПГС, так и внезапными наплывами показного цинизма. 

В этих ваших интернетах(и не только) мне также заявляли/намекали, что я: 
- либераст;
- петросян;
- толераст(в некоторых случаях - тоталераст, какбэ намекая на мою тотальную толерантность);
- хипстер; 
- говнарь;
- ТП;
- д'Артаньян;
- демагог;
- небыдло;
- быдло;
- гик;
- хуик;
- шкура;
- безбожница; 
- унылый троллик;
- 40-летний волосатый мужик; 
- фашист; 
- пидор;
- задрот;
- перфекционист;
- луркоеб;
- школьница.
Что ж, как минимум два пункта из этого - абсолютная правда. 

Если же даже вышесказанное не остановит вас, чтобы написать мне, то сразу скажу три вещи:

1. Частенько я очень долго могу не отвечать на сообщения.
2. Ужасно не переношу нытье по этому поводу. Вот вообще прям.
3. Да, это натуральный цвет, никогда не красилась и не собираюсь. 

+ герои, что пытаются присылать мне свои гениталии в личку без спроса и разрешения, автоматом идут в ЧС. Без обид.
